raw_source.text:
دعاء يجمع لك خير الدارين
{اللهم اغفرلي وارحمني واهدني وعافني وارزقني}
دعوات مباركة قال عنها النبي ﷺ:
{هؤلاء تجمع لك دنياك وآخرتك}
رواه مسلم.

